/**
 * Benutzt globale Objekte			: tlTL in BreakPointHandler
 * Aufgerufen von					: Klasse Simu allgemein
 * Ruft auf							: ----
 * 
 * @param
 * @return absyn.TLabel
 * @version V1.00 vom 24.02.1999
 */
Guard returnBreakPoint() {
	int seSize;
	int bvSize;
	int bvNeuSize;
	int seNeuSize;
	java.util.Vector tmpBvList;
	java.util.Vector tmpSeList;

	tmpBvList = simuObject.makeTab(scClone.bvars);
	tmpSeList = simuObject.makeTab(scClone.events);
	
	seSize = simuObject.seList.size();
	bvSize = simuObject.bvList.size();
	bvNeuSize = tmpBvList.size();
	seNeuSize = tmpSeList.size();

	//System.out.println("returnBreakPoint: Werte fuer seList: "+seSize+" "+seNeuSize);
	//System.out.println("returnBreakPoint: Werte fuer bvList: "+bvSize+" "+bvNeuSize);

	if ((seNeuSize > seSize) || (bvNeuSize > bvSize)) {
		return null;
	}
	else {
		return tlTL.guard;
	}
}
